import InvoiceHead from './InvoiceTop';

class Invoice extends Component{
    render(){
      return(
        <div class="centrado-porcentual">
          <div class="block">            

            <InvoiceTop/>
            
          </div>
        </div>
        );  
    }
}
export default Invoice;
